<template>
    <div class="notification">
        <div class="notification__item">Сумма по col3 = {{ this.sum }}</div>
        <div class="notification__item">Среднее по col4 = {{ this.average }}</div>
    </div>
    <table>
        <thead>
        <tr>
            <th colspan="3">GROUP1</th>
            <th colspan="3">GROUP2</th>
        </tr>
        <tr>
            <th>Col1</th>
            <th>Col2</th>
            <th>Col3</th>
            <th>Col4</th>
            <th>Col5</th>
            <th @click="handleSort">Col6 => :j</th>
        </tr>
        </thead>
        <tbody>
        <tr v-for="el in dataSet" @click="handleSerialize">
            <input type="hidden" :name="'id-' + el.id + 'col-1'" :value="el.val6">
            <input type="hidden" :name="'id-' + el.id + 'col-2'" :value="el.val1">
            <input type="hidden" :name="'id-' + el.id + 'col-3'" :value="el.val2">
            <input type="hidden" :name="'id-' + el.id + 'col-4'" :value="el.val4 + el.val5">
            <input type="hidden" :name="'id-' + el.id + 'col-5'" :value="el.val1">
            <input type="hidden" :name="'id-' + el.id + 'col-7'" :value="el.val8">
            <td name="imgPath"><img :src="el.val6" alt="img"></td>
            <td name="val1">{{ el.val1 }}</td>
            <td name="val2">{{ el.val2 }} кг</td>
            <td name="val4+val5">{{ el.val4 + el.val5 }}</td>
            <td name="styledVal1"><b><u>{{ el.val1 }}</u></b></td>
            <td name="val8">{{ el.val8 }}</td>
        </tr>
        </tbody>
    </table>
</template>

<script>

export default {
    data() {
        return {
            count: 0,
            dataSet: [],
            images: [
                'https://img.freepik.com/free-photo/wide-angle-shot-single-tree-growing-clouded-sky-during-sunset-surrounded-by-grass_181624-22807.jpg',
                'https://upload.wikimedia.org/wikipedia/commons/thumb/4/42/Shaqi_jrvej.jpg/1200px-Shaqi_jrvej.jpg',
                'https://natureconservancy-h.assetsadobe.com/is/image/content/dam/tnc/nature/en/photos/WOPA160517_D056-resized.jpg?crop=864%2C0%2C1728%2C2304&wid=600&hei=800&scl=2.88',
                'https://media.cntraveller.com/photos/611bf0b8f6bd8f17556db5e4/1:1/w_2000,h_2000,c_limit/gettyimages-1146431497.jpg',
                'data:image/jpeg;base64,',
                'https://cdn.pixabay.com/photo/2014/02/27/16/10/flowers-276014__340.jpg',
                'https://images.unsplash.com/photo-1610878180933-123728745d22?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8Y2FuYWRhJTIwbmF0dXJlfGVufDB8fDB8fA%3D%3D&w=1000&q=80',
                'https://natureconservancy-h.assetsadobe.com/is/image/content/dam/tnc/nature/en/photos/Zugpsitze_mountain.jpg?crop=0%2C176%2C3008%2C1654&wid=4000&hei=2200&scl=0.752',
                'https://www.eea.europa.eu/themes/biodiversity/state-of-nature-in-the-eu/state-of-nature-2020-subtopic/image',
                'https://cdn.corporate.walmart.com/dims4/WMT/572511c/2147483647/strip/true/crop/1920x1066+0+7/resize/980x544!/quality/90/?url=https%3A%2F%2Fcdn.corporate.walmart.com%2F7b%2F66%2F142c151b4cd3a19c13e1ca65f193%2Fbusinessfornature-banner.png',
                'data:image/jpeg;base64,',
                'data:image/jpeg;base64,',
                'https://thumbs.dreamstime.com/b/beautiful-rain-forest-ang-ka-nature-trail-doi-inthanon-national-park-thailand-36703721.jpg',
                'https://cdn-prod.medicalnewstoday.com/content/images/articles/325/325466/man-walking-dog.jpg'
            ],
            sum: 0,
            average: null,
            // true = from a to z
            // false = from z to a sorting
            sortDirection: true
        }
    },
    methods: {
        handleGenerateData(n) {
            this.dataSet = []

            for (let i = 0; i < n; i++) {
                const imgPathNumber = Math.floor(Math.random() * this.images.length)
                const valArray = ['str1', 'str2', 'str3', 'str4', 'str5']
                const valRandomNumber = Math.floor(Math.random() * valArray.length)
                const that = this

                const obj = {
                    id: i + 1,
                    val1: that.getRandomString(10),
                    val2: +(Math.random() * 1000).toFixed(2),
                    val3: +(Math.random() * 1000).toFixed(4),
                    val4: Math.floor(Math.random() * 100),
                    val5: Math.floor(Math.random() * 100),
                    val6: that.images[imgPathNumber],
                    val7: that.getRandomString(10),
                    val8: valArray[valRandomNumber]
                }

                this.dataSet.push(obj)
            }
        },
        getRandomString(length) {
            let result = ''
            const characters       = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789'

            for (let i = 0; i < length; i++)
                result += characters.charAt(Math.floor(Math.random() * characters.length))

            return result;
        },
        handleSerialize(event) {
            const childList = event.currentTarget.childNodes
            const valuesArr = []

            for (let el of childList) {
                if (!el.value) continue
                else valuesArr.push(el.value)
            }

            const data = {
                col1: valuesArr[0],
                col2: valuesArr[1],
                col3: valuesArr[2],
                col4: valuesArr[3],
                col5: valuesArr[4],
                col6: valuesArr[5],
            }

            console.log(JSON.stringify(data))
        },
        getSum() {
            this.dataSet.map(el => this.sum += el.val2)
        },
        getAverage() {
            let sum = 0
            this.dataSet.map(el => {
                sum += el.val4 + el.val5
            })

            this.average = sum / this.dataSet.length
        },
        handleSort() {
            // Если сортдирекшн = тру, то мы сортируем в обычном порядке. Если же нет, то мы сортируем от обратного
            // Форма записи кода мне пока не очень нравится, я бы это как-то упростил
            if (this.sortDirection) {
                this.dataSet.sort((prev, next) => {
                    if (prev.val8 > next.val8) return 1
                    else if (prev.val8 < next.val8) return -1
                })

                this.sortDirection = false
            } else if (!this.sortDirection) {
                this.dataSet.reverse()
                this.sortDirection = true
            }
        }
    },
    mounted() {
        // Генерируем 100 элементов массива
        this.handleGenerateData(100)
        this.getSum()
        this.getAverage()
        this.handleSort()
    }
}
</script>

